  true,\n\t\"url\": null,\n\t\"notes\": \"The National Assessment of Educational Progress,
  2007 (NAEP 2007), is a study that is part of the National Assessment of Educational
  Progress (NAEP) program; program data is available since 1990 at http://nces.ed.gov/nationsreportcard/naepdata/.
  NAEP 2007 (http://nces.ed.gov/nationsreportcard/) is a cross-sectional survey that
  assesses what America's students know and can do in various subject areas. The study
  was conducted using computer-based assessment of students. Students in grade 4,
  8, and 12 were sampled. NAEP 2007 assessments consist of national and state assessments
  in reading and mathematics, at grades 4 and 8; a national and state sample in writing
  at grade 8; and a national only writing sample at grade 12. The studyufffdufffds
